import React from "react";

const Prijava = () => {
  const [lozinka, setLozinka] = useState("");
  const handleLozinka = (event) => {
    setLozinka(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    console.log(kime);
  };
  return (
    <form onSubmit={handleSubmit}>
      <label>
        <p>Korisničko ime:</p>
        <input
          type="text"
          name="kime"
          placeholder="Korisničko ime"
          id="kime"
          value={kime}
          onChange={handleKime}
        />
      </label>
      <label>
        <p>Ime:</p>
        <input
          type="text"
          name="ime"
          placeholder="Ime"
          id="ime"
          value={ime}
          onChange={handleIme}
        />
      </label>
      <label>
        <p>Prezime:</p>
        <input
          type="text"
          name="prezime"
          placeholder="Prezime"
          id="prezime"
          value={prezime}
          onChange={handlePrezime}
        />
      </label>
      <label>
        <p>Lozinka:</p>
        <input
          type="text"
          name="lozinka"
          placeholder="Lozinka"
          id="lozinka"
          value={lozinka}
          onChange={handleLozinka}
        />
      </label>
      <button type="submit">Registracija</button>
    </form>
  );
};

export default Prijava;
